import { Switch, Route } from 'react-router-dom';
import { Home } from "./../pages/Home";
import { Settings } from "./../pages/Settings";

function App() {
  return (
    <Switch>
      <Route exact path="/">
        <Home />
      </Route>
      <Route exact path="/settings">
        <Settings />
      </Route>

      <Route>
